-- ==========================================
-- RECUPERAR QUIZZES POR EMAIL (DO BACKUP)
-- Gerado: 2025-11-21T17:12:32.446Z
-- Emails no backup: 3252
-- Quizzes para inserir: 3245

BEGIN;

-- Criar tabela temporÃ¡ria com mapeamento email -> quiz_id do backup
CREATE TEMP TABLE IF NOT EXISTS backup_email_quiz_map (
    email TEXT,
    quiz_id UUID
);

-- Inserir mapeamentos do backup

-- Identificar pedidos sem quiz que podem ser associados
CREATE TEMP TABLE IF NOT EXISTS pedidos_para_recuperar AS
SELECT 
    o.id as order_id,
    LOWER(TRIM(o.customer_email)) as email,
    b.quiz_id,
    o.created_at
FROM orders o
INNER JOIN backup_email_quiz_map b ON LOWER(TRIM(b.email)) = LOWER(TRIM(o.customer_email))
WHERE o.quiz_id IS NULL
    AND o.customer_email IS NOT NULL
    AND o.customer_email != ''
    AND NOT EXISTS (
        SELECT 1 FROM quizzes q WHERE q.id = b.quiz_id
    )
ORDER BY o.created_at DESC;

-- Inserir quizzes do backup

-- Atualizar pedidos com quiz_id
UPDATE orders o
SET quiz_id = p.quiz_id,
    updated_at = NOW()
FROM pedidos_para_recuperar p
WHERE o.id = p.order_id
    AND o.quiz_id IS NULL
    AND EXISTS (SELECT 1 FROM quizzes q WHERE q.id = p.quiz_id);

COMMIT;

